def _complex_op_():
    _m_ = [[random.randint(0, 100) for _ in range(10)] for _ in range(10)]
    _det_ = 0
    
    for i in range(len(_m_)):
        _det_ += _m_[0][i] * ((-1)**i)
    return _det_

